Este soneto pertenece a la poeta uruguaya Delmira Agustini (1886-1914), una de las voces más importantes del modernismo latinoamericano. El poema forma parte de su obra poética y refleja su característico estilo en el que aborda temas como el amor, la pasión y lo intangible desde una perspectiva femenina y modernista.
